import logo from "./logo.svg";
import "./App.css";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import ReactDOM from "react-dom";
import App from "./components/App.js";

function app() {
  return (
    <Router>
      <Switch>
        <Route exact path="/lists">
          <App />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
